INSERT INTO `pm_hotel` (`id`, `hotelid`, `lang`, `users`, `title`, `subtitle`, `alias`, `class`, `id_accommodation`, `address`, `address_1`, `address_2`, `city`, `state`, `zipcode`, `country_code`, `lat`, `lng`, `email`, `phone`, `web`, `descr`, `facilities`, `id_destination`, `paypal_email`, `book_policy`, `general_policies`, `cancel_policy`, `home`, `checked`, `rank`) VALUES
(19, '19', 2, '1,130', 'Eco Stay', '', 'eco-stay', 3, 7, 'Plot no AA-IIB 204', NULL, 'HIG 1 Action area 2B, 02-566 New Town', 'Kolkata', 'West Bengal', '700157', 'IN', 22.4941, 88.4381, 'reservation@guptahotels.com', '7699287925', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Ecostay in Kolkata is an ideal choice of stay for business and leisure travelers, offering fine services at budget rates. The property is well maintained by a trained and skillful staff who ensure all your needs are catered to.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The rooms are equipped with modern amenities like AC, Geyser and much more.</li>\r\n	<li>To ensure the safety of guests, the hotel provides facilities like fire safety, first aid and round the clock security.</li>\r\n	<li>Additionally, we have a 24-hour helpdesk to offer guests assistance at any hour.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<p>Head out to visit the key attractions of Kolkata like –</p>\r\n\r\n<ul>\r\n	<li> Eco Park</li>\r\n	<li> Mother’s Wax Museum</li>\r\n	<li> Central Park</li>\r\n	<li> Nicco Park.</li>\r\n</ul>\r\n', '68,72,66,91,77,78,69,67,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 1),
(20, '20', 2, '1,131', 'Eco Palace', '', 'eco-palace', 3, 7, 'Plot no AA-IIB/424', NULL, 'MIG 1,ActionArea IIB,6-0532, New Town', 'Kolkata', 'West Bengal', '700157', 'IN', 22.4941, 88.4381, 'reservation@guptahotels.com', '8170902908', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Eco Palace in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>Eco park and mothers wax museum.</li>\r\n	<li>There is Bank of India e-gallery, Bank and ATM nearby the hotel so you are never out of cash</li>\r\n</ul>\r\n', '68,72,66,91,69,67,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 2),
(21, '21', 2, '1,132', 'Eco Inn', '', 'eco-inn', 3, 7, 'AA-IIB,708 Premises no-21/574', NULL, 'New Town', 'Kolkata', 'West Bengal', '700161', 'IN', 22.5882834, 88.4734476, 'reservation@guptahotels.com', '7063176016', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Eco Inn is strategically located in Kolkata to offer you the best services at affordable rates. The establishment is maintained with a skilled and friendly roster of staff-members to ensure you have a memorable and comfortable stay.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The rooms are equipped with modern amenities like air-conditioning, card payment, geyser and much more.</li>\r\n	<li>The hotel provides facilities such as fire safety, first aid and round the clock security for the guest’s security.</li>\r\n	<li>We also have a 24-hour helpdesk to offer assistance to the guests at any time.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<p>Head out to visit the key attractions of Kolkata like –</p>\r\n\r\n<ul>\r\n	<li>Eco Park</li>\r\n	<li>Mother’s Wax Museum</li>\r\n	<li>Central Park</li>\r\n	<li>Nicco Park.</li>\r\n</ul>\r\n', '68,72,66,91,77,78,69,67,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 3),
(22, '22', 2, '1,133', 'Stay Inn', '', 'stay-inn', 3, 7, 'Natunpara,Bablatala,Gopalpur,', NULL, 'Rajarhat Main Road,Near Ark Plaza, Opp Derozio Collage', 'Kolkata', 'West Bengal', '700136', 'IN', 22.8283, 88.0778, 'reservation@guptahotels.com', '9635145760', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>With its easy accessibility to many key attractions, Hotel Stay Inn in Kolkata offers you a luxurious accommodation; experience grandeur and comfort at affordable rates when you stay with us. Our well-trained and courteous staff-members strive to maintain a top-notch establishment and ensure that your stay is smooth.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>Complimentary breakfast, in-house restaurant, parking facility and more are equipped in our property.</li>\r\n	<li>The hotel provides facilities like fire safety, first aid and round the clock security for the guests.</li>\r\n	<li>Additionally, we have a 24-hour helpdesk to offer assistance to guests at any hour.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>Explore Kolkata and visit the famous landmarks and attractions such as Central Park, Nalban and Nicco Park among others.</li>\r\n	<li>Axis Bank ATM and SBI ATM close to the hotel grant you financial liquidity at any time.</li>\r\n</ul>\r\n', '68,72,66,91,77,78,69,67,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 4),
(23, '23', 2, '1,134', 'Durbar Guest House', '', 'durbar-guest-house', 3, 7, '5/420 Kalipark Complex,Vidysagar Pally, ', NULL, 'Bablatala,Gopalpur,', 'Kolkata', 'West Bengal', '700136', 'IN', 22.8283, 88.0778, 'reservation@guptahotels.com', '6289939436', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Durbar Guest House is a rental property of minimalistic and classically tasteful architecture located in Vidyasagar Pally, Kolkata. The establishment is close in proximity to a landmark statue of Maa Durga,<br />\r\nAt Durbar Guest House you will find services within an affordable price range. The rooms are bright and beautifully finished and furnished with wooden furniture, including cupboards. The corridors and reception area is well maintained.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<p>All rooms have a queen-sized bed, AC, TV and elegant tiled bathrooms with geyser. The guest house also boasts of CCTV cameras, elevator and power backup. In this guest house, you will also have access to a kitchen where you can cook and store your food. Free internet facility is provided to all guests. Payments via cards are accepted here.</p>\r\n\r\n<p><strong>What’s Nearby</strong></p>\r\n\r\n<p>Guests can look forward to amusements such as the boating services at the nearby Eco Point, the Sculpture Garden and the Culture and Heritage of Bengal. There are numerous restaurants located in the vicinity of the guest house XII Zodiac, The Bahamas Love Cafe and Restaurant, Wang’s kitchen, PFC, Aminia Restaurant and Arsalan Restaurant & Caterer.</p>\r\n', '68,72,91,74,69,92,73,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a></p>\r\n', 1, 1, 5),
(24, '24', 2, '1,135', 'Chinnar Inn', '', 'chinnar-inn', 3, 7, '224 ,Bholanath Sarani Chinnar Park Naer ', NULL, 'Zenith motors ', 'kolkata', 'West Bengal', '700157', 'IN', 22.4941, 88.4381, 'reservation@guptahotels.com', '8697082953', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Chinnar Inn is a budget-friendly hotel of refined tastes. The hotel is located in the posh neighbourhood of Rajarhat in Kolkata. Chinnar Inn offers customers aesthetically designed and decorated rooms that prioritise comfort.<br />\r\nGuests can look forward to a well-furnished living space, with a lot of wooden elements used throughout for the interior decor of the rooms. The creative light setup design also infuses an ambiance of luxury. All the rooms have been provided with large windows with safety grills which let the guests enjoy some amazing views, fresh air and a lot of sunlight, without compromising security. </p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<p>Guests can look forward to facilities such as card payment in all forms, and amenities such as an elevator service, laundry provisions, CCTV cameras, and free Wi-Fi. All these facilities are maintained by a team of dedicated staff.</p>\r\n\r\n<p><strong>What’s Nearby</strong></p>\r\n\r\n<p>The hotel is located close to a number of eateries like A Sweet Surrender, The Cloud 9, and Aminia, for the benefit of the guests.</p>\r\n', '68,72,91,74,69,79,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 6),
(25, '25', 2, '1,136', 'Padmavati', '', 'padmavati', 3, 7, '24/2 Chinnar Park ', NULL, 'Behind NPG Hotel ', 'Kolkata', 'West Bengal', '700157', 'IN', 22.4941, 88.4381, 'reservation@guptahotels.com', '6290649294', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Padmavati Hotel in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>Netaji Subhash Chandra Bose Internatiol Airport, City center 2, Inox movie hall.</li>\r\n	<li>There is Bank of India e-gallery, Bank and ATM nearby the hotel so you are never out of cash.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n', '68,72,91,77,78,69,71,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 7),
(26, '26', 2, '1,137', 'Zapper Guest House', '', 'zapper-guest-house', 3, 7, '13/2/14 Jhowtalla Lane ', NULL, 'Near lokenath mandir ', 'Kolkata', 'West Bengal', '700157', 'IN', 22.4941, 22.4941, 'reservation@guptahotels.com', '8617235689', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Greetings from the ‘City of Joy’- Kolkata! Zapper Guest House is pleased to announce its services for guests. Zapper Guest House is serving guests since May 23, 2016.  The Guest House is located in Kolkata to make your stay more fantastic and offer you a memorable hotel-stay at a budgeted rate. You can easily reach the hotel from Netaji Subhash Chandra Bose International Airport by auto or a cab.<br />\r\nThe hotel is designed to make your stay more comfortable, with all the basic facilities provided within a budget fee. The establishment goes off the beaten path to ensure that everything is in place as reflected by their well-trained staffs.  </p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>Your room amenities will include a work table, intercom and a luggage rack for your belongings.</li>\r\n	<li>The hotel provides other facilities such as photocopier, fire safety, first aid, and round the clock security.</li>\r\n	<li>The hotel also offers amenities such as dry cleaning, free admission for children, and 100% power back-up and a lot more.</li>\r\n	<li>It is the perfect place to stay for families or young travellers for either leisure or business.</li>\r\n	<li>A 24-hour helpdesk to assist you at any hour of the day.</li>\r\n</ul>\r\n\r\n<p><strong>What’s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>Visit famous tourist attractions such as the Eco Tourism Park and Mother’s Wax Museum which are located nearby.</li>\r\n	<li>Choose your meal from the menus of nearby dining greats such as Arsalan Chinar Park, Subway, or Sizzler.</li>\r\n	<li>Head out to nearby shopping destinations such as City Centre 2 and Spencer\'s Axis Mall.</li>\r\n	<li>Nearby ATM service</li>\r\n</ul>\r\n', '68,72,91,77,78,69,80,92,70,81', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 8),
(27, '27', 2, '1,138', 'Pallyshree Guest House', '', 'pallyshree-guest-house', 3, 7, '2/3 Jayngra Teghoria Road Baguhati ', NULL, 'Near lokenath Mandir ', 'Kolkata', 'West Bengal', '700059', 'IN', 22.56263, 88.36304, 'reservation@guptahotels.com', '8917610760', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Pallyshree Guest House is a reasonably priced, deluxe-grade hotel located on the Jyangra-Tegharia Road, near Sitala Mandir in Baguiati locality, Kolkata. The hotel provides aesthetically designed rooms that offer a contrast of dark colour accented walls, light coloured floors and bright coloured drapes.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<p>In addition to the usual amenities like TV, AC, free Wi-Fi, kitchen and CCTV cameras the hotel also provides amenities like mini fridge and hair dryer for the convenience of their guests.</p>\r\n\r\n<p><strong>What’s Nearby</strong></p>\r\n\r\n<p>Guests can visit interesting places like Iskcon Krishna Kuthir, Sculpture Garden and Kolkata Museum of Modern Art which are located near this property. Guests looking for different types of food can visit restaurants like Aminia Restaurant, Momo I Am and Advieh which are located near this hotel. The Brahmachari Ashram bus station, Dum Dum Cantt train station and Netaji Subhash Chandra Bose International Airport are all located in the vicinity of this property.</p>\r\n\r\n<p> </p>\r\n', '68,72,91,69,67,71,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a></p>\r\n', 1, 1, 9),
(28, '28', 2, '1,139', 'Maruti Lodging', '', 'maruti-lodging', 3, 7, 'Shree tower 2,4 th floor RAA -36,', NULL, 'VIP Road Raghunathpur ', 'Kolkata', 'West Bengal', '700059', 'IN', 22.6200222, 88.4321592, 'reservation@guptahotels.com', '8697554142', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Hotel Maruti Lodging is located on the VIP Road in Kolkata. The hotel offers comfortable rooms that are designed with a lot of thought for guests in search of pocket-friendly prices. Rooms painted aesthetically in bold blues along with intricate patterns offer a breezy, homely feel to the guests. Well-lit rooms with tasteful illumination are a plus. Large windows have been provided in all rooms for the benefit of the guests. The windows have been covered with long and thick curtains. An extra addition to every room is the plush couch for lounging.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<p>The additional features provided by the hotel are free Wi-Fi, an uninterrupted power backup source, an elevator facility, a conference room, and a banquet hall. The front desk service is also elegantly decorated and is handled by helpful and experienced staff.</p>\r\n\r\n<p><strong>What’s Nearby</strong></p>\r\n\r\n<p>The hotel is located close to the Netaji Shubhash Airport, Dumdum Metro Station, and Bidhannagar Railway Station, etc. Popular dining options such as Vegout, KFC, are also located nearby, alongside shopping destinations.</p>\r\n\r\n<p> </p>\r\n\r\n<p></span></p>\r\n', '68,76,72,75,91,74,69,92,73,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 10),
(29, '29', 2, '1,140', 'Pratiksha Guest House', '', 'pratiksha-guest-house', 3, 7, '68/1 Bangur AVENUE Block -B,', NULL, 'Behind Reliance Fresh ', 'Kolkata', 'West Bengal', '700055', 'IN', 22.607285, 88.4105742, 'reservation@guptahotels.com', '8608975158', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Pratiksha Guest House in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>To make the most of your visit, head out to famous tourist spots like Central Park, Pareshnath Temple and Lokenath Santiniketan Ashram.</li>\r\n	<li>There is Bank of India e-gallery, Canara Bank ATM and UCO Bank nearby the hotel so you are never out of cash.</li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<p><span data-cke-marker=\"1\"> </p>\r\n', '68,72,91,77,78,69,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 11),
(30, '30', 2, '1,141', 'Upasana Guest House', '', 'upasana-guest-house', 3, 7, '35/1 , Bangur Avenue ', NULL, 'Block-D ', 'Kolkata', 'West Bengal', '700055', 'IN', 22.607285, 88.4105742, 'reservation@guptahotels.com', '9874488624', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Upasana Guest House in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<ul>\r\n	<li>Netaji Subhash Chandra Bose Internatiol Airport, Bangur Bus Stop,  Central Park Station Metro Station, Patipukur Railway station.</li>\r\n	<li>There is Bank of India e-gallery, Bank and ATM nearby the hotel so you are never out of cash.</li>\r\n</ul>\r\n', '68,72,91,69,92,70', 1, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 12),
(31, '31', 2, '1', 'Honey Inn', '', 'honey-inn', 3, 7, '529/41 M.10, Pattaya 2nd Rd.,', NULL, 'Soi 11 Pattaya City,', 'Pattaya', 'Chonburi ', '20150', 'TH', 12.93333, 100.88333, 'reservation@guptahotels.com', '9875309285', '', '<p><strong>Description:</strong></p>\r\n\r\n<p>Offering a restaurant and a la carte restaurant, Honey Inn is located in Pattaya Central. Free Wi-Fi access is available. Other facilities offered include a shared lounge, a tour desk and a 24-hour front desk.</p>\r\n\r\n<p>The property is 1 mi from Royal Garden Plaza, 0.8 mi from Alcazar Cabaret and 0.7 mi from Central Festival Pattaya Beach Mall. Suvarnabhumi Airport is 53 mi away. On-site parking is possible.</p>\r\n\r\n<p>Rooms here are provided with a flat-screen satellite TV, air conditioning and a balcony. Featuring a shower, private bathrooms come with a hairdryer and free toiletries. Extras include a mini-bar, a seating area and an electric kettle.</p>\r\n\r\n<p>Couples in particular like the location – they rated it 8.0 for a two-person trip.</p>\r\n\r\n<p>We speak your language!</p>\r\n\r\n<p><strong>Honey Inn has been welcoming guests since Mar 10, 2014</strong></p>\r\n\r\n<p><strong>Facilities</strong></p>\r\n\r\n<p>Free parking, Airport shuttle, Non-smoking rooms, Room service, Restaurant Bar Breakfast</p>\r\n\r\n<p><strong>What\'s Nearby</strong></p>\r\n\r\n<p>Closest Landmarks *<br />\r\nSeafari Dive Center, The Avenue Pattaya, Central Festival Pattaya Beach, Pattaya Memorial Hospital, Ripley\'s Believe It or Not, Royal Garden Plaza, Hard Rock Cafe Pattaya, Pattaya Walking Street, Harbor Pattaya, Alcazar Cabaret, ATM</p>\r\n\r\n<p>Restaurants & Markets *<br />\r\nTHE CORNER RESTAURANT</p>\r\n\r\n<p>Beaches in the Neighborhood *<br />\r\nPattaya Beach</p>\r\n\r\n<p>Closest Airports *<br />\r\nU-Tapao Rayong-Pattaya International Airport, Suvarnabhumi Airport</p>\r\n\r\n<p>Most Popular Landmarks *<br />\r\nPattaya - Hua Hin Ferry, Na Baan Pier, Suanthai Pattaya</p>\r\n', '72,84,66,91,69,85,71,86,92,89,82,88,87,83,90', 2, NULL, '', '', '<p> </span> In case of cancellation please contact to Hotel Admin <a href=\"http://help@guptahotels.com\">help@guptahotels.com</a> and please check our </span><a href=\"https://guptahotels.com/terms-conditions\" target=\"_blank\">Terms & Conditions</a> <span da', 1, 1, 13),
