(1, 2, '2', 'All Inclusive Gateway Package', 'all-inclusive-gateway-package', 1, 2, 7, '42,41,43', 1845, '<p>Sun. Sand. Unlimited fun, with all-inclusive vacation packages and hotel deals at select Marriott brand destinations, you can make the most of every moment. Feel truly pampered as you enjoy meals, drinks and more. Search for dates at our hotels worldwide.</p>\r\n\r\n<h3>Inclusions</h3>\r\n', '2', 2, 0, 1564617600, 1567209600, 1),
(2, 2, '2', 'Business Travel Package', 'business-travel-package', 3, 13, 18, '45,46,47,48', 1549, '<p>Gupta Hotels offer \'Business Travel’, designed to suit your business travel needs. Your special requests are now available with our compliments to make your business trip a truly comfortable and rewarding experience.</p>\r\n\r\n<h3>Inclusions</h3>\r\n', '3', 2, 1, 1546300800, 1577750400, 1),
(16, 2, '1', 'Special Summer Package', 'special-summer-package', 1, 2, 7, '44,49,50,51,52,53,54,56,55', 2599, '<p>Beat the heat this summer with special package at the Gupta Hotels. Whether you had a long hectic week and yearning for a short breaks to rejuvenate or would like to pamper yourself and family with finest form of indulgences, none provides a better option than Gupta Hotels. Our summer packages are therefor designed to make every moment of your stay an incredible one.</p>\r\n\r\n<h3>Inclusions</h3>\r\n', '3', 2, 1, 1564617600, 1569801600, 1),
(17, 2, '1', 'Honeymoon Bliss Package', 'honeymoon-bliss-package', 2, 10, 17, '57,58,59,60,61,62,63,64,65', 2500, '<p>Travel to the destination of your dreams, and let Gupta Hotels help you fill your love story with champagne, room service and other indulgences. Search dates and rates and create a getaway you’ll never forget.</p>\r\n\r\n<h3>Inclusions</h3>\r\n', '3', 2, 0, 1565049600, 1577750400, 1);
