(5, 2, 'About us', 'About us', '', 'About us', 'about-us', '', 'index,follow', '', '', '<p><em><strong>Gupta Hotels</strong></em> was born from the need to provide the traveller of refined tastes with a premium-grade, luxury accommodation solution in Kolkata. Thousands visit the City of Joy every day for a multitude of reasons. It is our mission to provide these esteemed guests of ours with a home away from home in the lap of luxury, cosiness, and splendour. </span></p>\r\n\r\n<p>Gupta Hotels was conceived bearing in mind the ancient Indian tradition of- ‘<em><strong>Atithi Devo Bhava</strong></em>’. We wanted to present travellers, tourists and vacationers with a de facto accommodation solution of distinguished standards. </span></p>\r\n\r\n<p>Our hotel in Kolkata has been built on a foundation of:</span></p>\r\n\r\n<ul>\r\n	<li>Warmth </span></li>\r\n	<li>Hospitality</li>\r\n	<li>Luxury</li>\r\n	<li>Comfort, and</span></li>\r\n	<li>Courtesy</li>\r\n</ul>\r\n\r\n<p>Regardless of whether you are travelling for pleasure or business, you can assuredly find a second home with us, at Gupta Hotels. </span></p>\r\n', NULL, 'page', '', 0, 1, 4, 1557396800, 1566382174, 0, 0, 0),
