(54, 2, 31, NULL, '1', 0, 3, 3, 1, 'Superior', '', 'superior-double-room-with-balcony', '<p>This double room features a balcony, seating area and air conditioning.</p>\r\n\r\n<p><strong>In your private bathroom:</strong></p>\r\n\r\n<p> Bathtub<br />\r\n Free toiletries<br />\r\n Shower<br />\r\n Towels<br />\r\n Linens<br />\r\n Hairdryer<br />\r\n Towels/Sheets (extra fee)</p>\r\n\r\n<p><strong>Room Facilities: ​</strong></p>\r\n\r\n<p> Electric kettle<br />\r\n Sitting area<br />\r\n Minibar<br />\r\n Wake-up service<br />\r\n Air conditioning<br />\r\n Safe<br />\r\n Balcony<br />\r\n Telephone<br />\r\n Satellite channels<br />\r\n Flat-screen TV<br />\r\n Wardrobe or closet<br />\r\n Clothes rack</p>\r\n\r\n<p><strong>Parking: ​</strong></p>\r\n\r\n<p> Free private parking is possible at a location nearby (reservation is not possible).</p>\r\n', '84,85,86,89,82,88,87,83,90', 5, 2000, 'Queen', '', 1, '', 0, '', NULL, NULL, NULL, '', 1, 23, NULL, NULL),
(55, 2, 31, NULL, '1', 0, 5, 5, 1, 'Deluxe', '', 'deluxe-double-room-with-balcony', '<p>Located towards the front of the building, this double room features a balcony, electric kettle and air conditioning.</p>\r\n\r\n<p><strong>In your private bathroom:</strong><br />\r\n Bathtub<br />\r\n Free toiletries<br />\r\n Shower<br />\r\n Towels<br />\r\n Linens<br />\r\n Hairdryer<br />\r\n Towels/Sheets (extra fee)</p>\r\n\r\n<p><strong>View:</strong><br />\r\n View</p>\r\n\r\n<p><strong>Room Facilities: ​</strong><br />\r\n Clothes rack<br />\r\n Wake-up service<br />\r\n Minibar<br />\r\n Electric kettle<br />\r\n Wardrobe or closet<br />\r\n Air conditioning<br />\r\n Safe<br />\r\n Balcony<br />\r\n Telephone<br />\r\n Satellite channels<br />\r\n Flat-screen TV<br />\r\n Sitting area</p>\r\n\r\n<p><strong>Parking:</strong> ​<br />\r\n Free private parking is possible at a location nearby (reservation is not possible).<br />\r\n </p>\r\n', '84,85,86,89,82,88,87,83,90', 6, 2400, '', '', NULL, '', 0, '', NULL, NULL, NULL, '', 1, 24, NULL, NULL),
(56, 2, 32, NULL, '1,136', 1, 3, 4, 1, 'Classic', '', 'padmavati-projects', '<p><strong>Description:</span></strong></span></p>\r\n\r\n<p>Padmavati Projects Hotel in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</span></p>\r\n\r\n<p><strong>Facilities</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</span></li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</span></li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</span></li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>Netaji Subhash Chandra Bose Internatiol Airport, City center 2, Inox movie hall.</span></li>\r\n	<li>There is Bank of India e-gallery, Bank and ATM nearby the hotel so you are never out of cash.</span></li>\r\n</ul>\r\n', '68,72,66,77,78,69,67,80,73,89,88,70,90,81', 12, 999, 'Queen', '', NULL, '', 1, '', NULL, NULL, NULL, '', 1, 25, NULL, NULL),
(57, 2, 33, NULL, '1', 1, 2, 3, 1, 'Saver', '', 'airport-view', '<p><strong>Description:</span></strong></span></p>\r\n\r\n<p>Airport View Hotel in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</span></p>\r\n\r\n<p><strong>Facilities</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</span></li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</span></li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</span></li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>Netaji Subhash Chandra Bose Internatiol Airport, City center 2, Inox movie hall.</span></li>\r\n	<li> Bank and ATM nearby the hotel so you are never out of cash.</span></li>\r\n</ul>\r\n\r\n<p></span></p>\r\n', '68,72,66,77,78,69,67,80,73,82,88,70,90,81', 4, 799, 'Queen', '', 1, '', 1, '', NULL, NULL, NULL, '', 1, 26, NULL, NULL),
(58, 2, 33, NULL, '1', 1, 3, 4, 1, 'Classic', '', 'airport', '<p><strong>Description:</span></strong></span></p>\r\n\r\n<p>Airport View Hotel in Kolkata is an ideal choice of stay for those travelling either for business or leisure. The establishment offers fine services at budget rates. Maintained by a skilled and friendly roster of staff-members, the hotel ensures you have a positive rental experience.</span></p>\r\n\r\n<p><strong>Facilities</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>The property offers AC, Geyser and more.</span></li>\r\n	<li>We take our guests safety seriously and provide facilities like fire safety, first aid and round the clock security to ensure the same.</span></li>\r\n	<li>Our 24 hour helpdesk ensures your needs and requirements are catered to.</span></li>\r\n</ul>\r\n\r\n<p><strong>What\'s Nearby</span></strong></span></p>\r\n\r\n<ul>\r\n	<li>Netaji Subhash Chandra Bose Internatiol Airport, City center 2, Inox movie hall.</span></li>\r\n	<li> Bank and ATM nearby the hotel so you are never out of cash.</li>\r\n</ul>\r\n', '68,72,66,77,78,69,67,80,73,82,88,70,90,81', 10, 999, 'Queen', '', 1, '', 1, '', NULL, NULL, NULL, '', 1, 27, NULL, NULL);
